import React, { useState } from 'react';
import { Modal, Button } from 'react-bootstrap';

export default function ReadMeModal() {
   const [show, setShow] = useState(false);
   const handleClose = () => setShow(false);
   const handleShow = () => setShow(true);

   return (
      <>
         <Button className='bg-transparent border-0' onClick={handleShow}>
            <code>README.md</code>
         </Button>

         <Modal show={show} onHide={handleClose} centered>
            <Modal.Header closeButton>
               <Modal.Title>Read Me</Modal.Title>
            </Modal.Header>
            <Modal.Body>
               <h4>Field Palmer</h4>
               <p>
                  Welcome to my portfolio! I am a web developer and software engineer
                  with a passion for creating and maintaining web applications. I enjoy
                  working with React, Node.js, and Express. I am also proficient in
                  HTML, CSS, and JavaScript. I have experience with MongoDB and MySQL
                  databases. I am currently seeking a full-time position as a web
                  developer or software engineer. Please feel free to reach out to me
                  with any opportunities or questions. Thank you for visiting!
               </p>
            </Modal.Body>
            <Modal.Footer closeButton>
               {/* <Button variant='secondary' onClick={handleClose}>
                  Close
               </Button> */}
            </Modal.Footer>
         </Modal>
      </>
   );
}
